window.onload = function hideButtons(){
    const video = document.querySelector(".phrase_video");
    const speedButton = document.querySelector(".button_hide .slow-ratio__speed-change");
	const playButton = document.querySelector(".button_hide .pe_play-button");
	
    var clicked = 0;
	var numberOfButtons = document.querySelectorAll(".puzzle__item--default").length;
    for (var i = 0; i < numberOfButtons; i++){
    var puzzle = document.querySelectorAll(".puzzle__item--default")[i];
	puzzle.addEventListener("click", function (){
		if (clicked == 0){	 
		
        playButton.style.opacity = '1';
		speedButton.style.opacity = '1';
		clicked = 1;
		}
    });
	};
    video.addEventListener('play', () => {
		playButton.className = 'pe_play-button2';	
        playButton.style.opacity = '0';
		speedButton.style.opacity = '0';
		clicked = 0;  
    });
    video.addEventListener('pause', () => {
		
		playButton.style.opacity = '1';
		speedButton.style.opacity = '1';
		
    });
};
	
var CounterCorrect = 0;
var CounterWrong = 0;
var timer;
var timerOn = 0;

function startTimer() {
    let seconds = 0;
    timer = setInterval(function () {
        seconds++;
        document.getElementById('TimerDisplay').innerHTML = `${seconds}`;
		
    }, 1000);	
};

 function calculateAndDisplayResult() {
	const correct = parseInt(document.querySelector('#CounterCorrect').textContent);
    const wrong = parseInt(document.querySelector('#CounterWrong').textContent);
    const time = parseInt(document.querySelector('#TimerDisplay').textContent);
    const result = correct*1000 / (time+wrong*5);
    const rounded = Math.ceil(result);
    document.getElementById('result').textContent = `${rounded}`;
	const element = document.getElementById("under-title");
	setTimeout(function() {
		        audio.playSound(window['HOME'] + '/finish.mp3');
                window.scrollTo({ top: document.body.scrollHeight, behavior: 'smooth' });	
            }, 500);
	
};


